('8455', '985', '15', '2', 'Fix for faltering faith teaching. Oct 26, 2014 11am Service\r\nMark 9:14-30\r\nGod has allowed certain things in your life, to test you\r\nDon\'t stop waiting, don\'t stop believing.\r\nFaith involves sacrifice'),
