('1632', 'I was recently laid off.. I spend my days searching for a job. I was able to pay Novembers rent and utilities and trying to stay positive. However I have no means to pay my December rent or past due car payment for  Nov. and December out of the question. I have 2 adult children with Sickle Cell Anemia and another that\'s bi polar. I try to be a positive light for them. Just asking for prayer for my family and my finances. I feed the homeless every other Thursday and am fearful I may be on the other end of the serving spoon very soon. Happy services are online now- my cable still on so I can stay connected because I\'m low on cash I can\'t afford gas to come in person. '),
('2235', 'Greetings,\r\n\r\nHI, this message is intended to register my children for the bike drive.\r\nI have 4 of them,\r\nBoy 3yr Ezra \r\nGirl 4yr Jayla\r\nGirl 6yr amandalyn\r\nand Quentin 10yr\r\n\r\nHappy Holidays,\r\n\r\nCiera Smith\r\nPhone: (407)440-8593\r\nEmail: edelinadorje213@gmail.com'),
('2241', 'I have been attending The River for the past three months or so, I am a broker agent for Florida Blue and my interest is to share with the congregation how health care reform will change their lives due to the new laws, the tax credits, also how the laws effect families with employer coverage. I would like to speak with Administrators of the church perhaps discuss if all possible to share my knowledge with seniors as well as younger folk with children to assist them with questions about the reform and how it might assist everyone in question.\r\nThank you for your time.\r\n'),
('2302', 'sin always brings about DEATH, Hebrews 6: 1-12, i will not become sluggish i will finish to the end disappoints are what you are expected to find, psalms 62:5 do not but my confidence in any man put all of my confidence in GOD, and GOD only wait on the LORD ..and be of good courage...proverbs 26:17 MIND MY OWN BUSINESS  ......'),
('2334', 'Hello, My husband and I recently became members of your ministry and I would like to know how we can get our 6 month old son dedicated. Do you offer some sort of group ceremony or individual. How does it work? \r\n\r\nThank you in advance for your prompt response. ');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('2335', 'Take notes here, then email them to yourself by clicking below.\r\n\r\n\r\nThe five enemies to focus\r\n\r\n1- Flesh, (appetite)\r\n2- Material Things (stuff)\r\n3- Wrong Relationships\r\n4- Offenses (Peter was offended & followed Jesus from afar, spiritually & physically)\r\n5- Comfort'),
('2337', 'It\'s not your job to critique others, keep your eyes on your mission\r\nYou\'ll never enter into the next chapter of your life if you don\'t let the past go\r\nYou may not alwasy appreciate or celebrate the voice of the person who helps you maintain your focus, but without them you will make terrible mistakes \r\nIf you maintain focus you will experience long term success\r\nYou have to recognize people who come into your life with the purpose of distracting you from your destiny. \r\nBe careful of poeple who get close to you and tell you what you ought to be doing\r\nGod has allowed us to see others around us fail in areas where He promised we would succeed\r\nYou have to talk about where you\'re going even though you don\'t know how you\'re going to get there. \r\nLook from the place where you are now and see better...that\'s why God gave you an imagination\r\nFive Enemies of Focus: \r\n1. Appetites -your flesh has appetites. The devil knows exactly what you like. \r\n2. Materialism-Be careful of having too many material things. You can\'t take it with you\r\n3. Wrong Relationships-\r\n4. Offenses-\r\n5. Comfort-the greatest enemy to your potential is your greatest success \r\nWhatever\r\n'),
('2396', 'Hello my name is laura I need help I have no one to turn to I just need $1000 loan from the church I will pay it back I need it for a apartment/house and a car my car on Craigslist is $500 or if yous have a car for me that would be great and I know I can find a house for a $500 move in I have done it before so please help me'),
('2464', 'Many blessings to you and your family in this wonderful season. I pray all is well with you all. My name is Marcelline Lazarre and I am a bride getting married on May 17, 2014 in search for a sanctuary to host our ceremony. We are having 250 guest and have been searching for a couple of weeks for the perfect location. My fianc and I are members of Calvary Christian Center Orlando Campus and we wanted to know if it would be possible to host our ceremony at your facility, if it is available on this date. If so please forward us the cost and any forms that maybe needed to be filled out. Thank you so very much for taking the time out of your busy day to respond to my email. If any questions please do not hesitate to contact me via phone at 239-357-1945. Hope to hear from you soon. God bless!\r\n\r\n '),
('2470', 'Hello Pastor Jackson,\r\nI pray that you and your family had a blessed holiday. I am humbling requesting an opportunity to speak to you and Mrs. Jackson about some events that took place in my life this year and also becoming more involved in my church. I understand you are extremely busy but your advice would be greatly appreciated. \r\n\r\nThank you in advance,\r\nCurtis McCullough'),
('2550', 'Maintain Your Faith. 12.29.13\r\n\r\n*1 Peter 1:1-12\r\n-everything needs maintenance \r\n-it\'s more than just being saved\r\n\r\n*2 Peter 12:1-2\r\n-my faith has to be treated as something special/precious\r\n-somethings may be easy to go back to so we should not allow it or be around it \r\n-sometimes we have to stand alone/apart in order sometimes to protect our faith\r\n\r\n*Matthew 16:24\r\n-I have to manage my appetite \r\n\r\n*2 Samuel 12:12-14\r\n-just because God forgave you doesn\'t mean people will\r\n\r\n-make sure your faith is precious\r\n-I should be further along in my faith'),
('2552', 'Take notes here, then email them to yourself by clicking below.\r\nAdditives for your life,  I will never be unfruitful\r\nIt\'s more than just being saved.  1Peter 1:7\r\nChange your behavior, Stand fast  and protect my faith it\'s precious\r\n\r\nPeople try your faith\r\n2 Samuel 12:14\r\nTeachers are judged more harshly and managed your appetite.\r\n\r\nKeeping God first.  Grace and peace be multiplied.\r\nWhe you have peace, people try to take it from you.\r\n'),
('2636', 'Good morning,\r\n\r\nI am hoping you can help be obtain tax information necessary to file my 2013 taxes for the time my children, Nailah and Noah Goodson attended this year.  My physical address is 1741 Grande Pointe Blvd. 19111, Orlando, FL 32839.  However, my mail is automatically forwarded to my P.O. Box 550726, Orlando, FL 32855.  If mail correspondence will be sent it is best to use my P.O. Box address as the post office will usually return, instead of auto-forward financial documents.  Please feel free to call my anytime.  Thank you in advance and God Bless.\r\n\r\nTonya'),
('3375', 'Good afternoon. I have been to your service on new years eve and was truly blessed. I am quite interested in fellowshipping with you but I have no transportation. Does your church have a bus for pickups? And if so what areas do you service? Thanks for your response. Awaiting anxiously.'),
('3750', 'I attended your church when it was on old winter garden, at that my spirit was really lost and I needed guidance.  I tried to reach out for pastoral counseling and was told no since I wasnt a member.This memory is reason why I pulled out of church, along with the fact that the people greeters women mainly are so rude, on New Years I attended with my son and he recognize the way people would look you dead in face turn as if you werent standing there.  \r\nI have begun my search for a new church home which mostly likely will be a small church but I wanted to share my experience, not all the people were rude, I am also aware that new years was busy but this transpired at old facility as well. May God Bless you ');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('3794', 'Take notes here, then email them to yourself by clicking below.\r\n\r\nEverything that you do you should do it in excellent. \r\nReview your job performances and start doing it in excellent. \r\nTry to improve you in all your areas.'),
('4004', 'Saw rev . Jackson this week for the first time. Can he move to Toronto. ? :)    I would like a copy off thhe program i enjoyed this week please.  Can I watch himm in Toronto. ?     Apt 407--222 Wellesley ave east Toronto Ontario  Canada m4x1g4 '),
('4263', 'Would like to serve in the audio department. I have 20yrs of experience working as an audio engineer. I do systems integration and live sound in the gospel music industry. I have also worked for NFL and University of Michigan'),
('4286', 'For we wrestle not against flesh and blood but against spiritual wickedness in high places. \r\nWe have to put on the whole armor  of God  Take no notice of how your treated, but let God fight  your battles. Have faith and never quit. No matter what the world does, do what God instructed in the word.  The devil will use anyone, and they will not be aware of it. A child of God loves good things, and hates what God hates. Be strong in the Lord, not just on Sundays but always. You are a child of God act like it. Fear not, love strong, walk forward , encourage yourself, If God is for you, it doesn\'t matter whose against you.   I love my Pastors... Pastor Jackson you really preached this morning.\r\n.'),
('4402', 'Greetings,\r\nMy husband and I are interested in having our two year old dedicated.  Is this possible? If so, how would we go about having that done? We are members in good standing. \r\n\r\nThanks in advance for your help in this matter. '),
('4949', 'Can you kindly include me in your future email upates at MILOKIDS@AOL.COM , also as a member I would like to know if I can purchase the 2 CD\'S done in 2009 on \"Letting Go\" also would like to receive information on this Tuesday Evenings event and future events, Thank You, Monique Aletti\r\n\r\nI do get your phone messages but I work as a nurse in the prison so many times am without a cell phone as it is not allowed in the prison, but I do want to attend Tuesday evening and look forward to the details, Thank You'),
('5305', 'I realize the the cut off time was yesterday to put in for the Super Bowl party, but was hoping I might still participate.  I can be reached at 407-353-6722.  What ever the cost I can pay either cash or credit.'),
('5311', 'For the past 3 months I have been without transportation. I am a single mother and a full time nursing student. It has been difficult arranging rides for me to get to and from school and my clinical sites. I am praying for some reliable transportation that is going to last me at least for the next 2 years while I complete this program. I appreciate all prayers in this.'),
('5317', 'Hello, last sunday i wrote a check for my tithe and forgot to transfer the money and see that the check got sent back. I really need to know how to get the money to you all after such a careless mistake.'),
('5360', 'I wanted to request our end of year giving statements. I hope this is the correct form to fill out. If not, could you please direct me to where I need to go to fill this out? Other numbers that you can reach me or my wife at would be: 757-339-7965 or 757-277-1357. Thank you. ');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('5418', 'I became of member of River of Life, because I am seeking the live my life for Jesus. Which I moved her from Gainesville, FL. and I was member of the Spirit of Faith, which I truly enjoyed be a member of the church. But, now that I am not employed I feel a need to be part of the christian society in helping people in anyway that I can, as Jesus has blessed me. I have been going through some situation in my life that I am not proud of and I truly believe that this is the reason some things has happen, that this actually give me the time I need to spend with God.'),
('5444', 'I am 59 yrs. of age, and I have had several thing throughout my life that has happened. But, even though through my sickness and in need of God he as been always been  there when I needed him the most. So there is not a reason for me not believing, having faith, and trusting in \r\nGod Words. I know that I have to be accountable for any wrongdoing that I have done, whether it in words, deeds or thoughts. But, for a year I have been unemployed and had a job for 3 months and not its impossible for me to maintain my financial situation is really a burden, but I am thankful that I have family to help me with a place to lay my head, food, and clothing, but I am very thankful for the presence of God everyday and throughout the day. But,its something in my life is just not right.  I know that God is alive is present in my life. I have been praying for a job for a year moving from one part of the Florida to where I am residing now, and I still have this struggle in my life. I really don\'t why I am sending this message, I quess that I really need for someone to hear me.'),
('5450', 'Hi, my team is having a Krispy Kreme donut fundraiser to try and raise money so we can pay for our entry fees, meets, new equipment and traveling funds. We are selling donuts for $6.50 a dozen. If people dont want to buy, we are more than willing to accept donations of any amount. We really want to go to FSU relays! The money has to be turned in by next Wednesday. Checks are accepted just make it out to Ocoee High School. I really need your help. Thank you!\r\n'),
('5468', 'Hello, last sunday i wrote a check for my tithe and forgot to transfer the money and see that the check got sent back. I really need to know how to get the money to you all after such a careless mistake.'),
('5642', 'Choir selection:\r\n1. \"It\'s Because of You\"\r\n2. \"Smile\"\r\n\r\nProverbs 18:20-21 KJV\r\nMark 11:12-14,19-24 KJV \r\n\r\nSermon: Power of Creative Confession\r\nBits of information came with a Threat and Opportunity, also a feeling of intimidation \r\nStay in an invironment of faith\r\nLove, Power and a Sound Mind\r\nManifestation of fear\r\nShyness is a manifestation of fear\r\nIntimidation is a manifestation of fear\r\nThat is when you are not in faith\r\nGrasp the moment and pray to God\r\nRepeat back to God to what He says about you.\r\nNo weapon \r\nGreater is me\r\nMore than a concurer\r\nWhen my enemies \r\nthe Lord is my refuse\r\nWhen you confess Gods word will not empty or void...\r\nDoors of opportunity is there, but it takes faith to step through that door.\r\nBlessing is on the other side of your act of faith\r\nHebrews 11:3 KJV\r\nThrough faith we believe the worlds were framed by the word of God.\r\nGod stepped out and God said. There was nothing till God Said.\r\nGenesis 1:\r\n1 Corethians \r\nKeep pressure on the word, because the more you say it the more you will believe it.\r\nCreative Confession.\r\nI know I\'m supposed to be wealthy\r\nWe believe therefore it shall happen. \r\nThe power of confession\r\n'),
('5644', 'Choir selection:\r\n1. \"It\'s Because of You\"\r\n2. \"Smile\"\r\n\r\nProverbs 18:20-21 KJV\r\nMark 11:12-14,19-24 KJV \r\n\r\nSermon: Power of Creative Confession\r\nBits of information came with a Threat and Opportunity, also a feeling of intimidation \r\nStay in an invironment of faith\r\nLove, Power and a Sound Mind\r\nManifestation of fear\r\nShyness is a manifestation of fear\r\nIntimidation is a manifestation of fear\r\nThat is when you are not in faith\r\nGrasp the moment and pray to God\r\nRepeat back to God to what He says about you.\r\nNo weapon \r\nGreater is me\r\nMore than a concurer\r\nWhen my enemies \r\nthe Lord is my refuse\r\nWhen you confess Gods word will not empty or void...\r\nDoors of opportunity is there, but it takes faith to step through that door.\r\nBlessing is on the other side of your act of faith\r\nHebrews 11:3 KJV\r\nThrough faith we believe the worlds were framed by the word of God.\r\nGod stepped out and God said. There was nothing till God Said.\r\nGenesis 1:\r\n1 Corethians \r\nKeep pressure on the word, because the more you say it the more you will believe it.\r\nCreative Confession.\r\nI know I\'m supposed to be wealthy\r\nWe believe therefore it shall happen. \r\nThe power of confession\r\n'),
('5765', 'Pastor Marvin,\r\n\r\nI would like to ask you a question concerning such curses? When CHRIST came and died to forgive every/all sin in the world, don\'t you think that would include curses of any kind past, present and future alike?? Were not the generational curses promised to the children of Jacob/Israel for the disobedience of their forefathers because they would not change their ways and obey YHWH/GOD the father and his Prophets. Deut. 28:15-68; Lev. 26:14-46 were written form the disobedient chosen peoples of Israel, because they knew GOD had chosen them, but they still disobeyed HIM and the Prophets. When CHRIST died for all sin that took away every one, now if we as Human Beings don\'t believe and/or listen to the GOSPEL we suffer as individuals and not because of what our forefathers did in their lives and we will all be judge accordingly when we stand before the GREAT JUDGEMENT/BEMA SEAT of YHWH/GOD. Please let me know by Scriptural knowledge what you think???\r\n\r\nI appreciate  you telling your Congregation that gambling is not in the Scriptures, you are the only TV Pastor I ever heard say that to his members.\r\n\r\nThank you in advance and may YHWH/GOD bless you always and only,\r\nBrother Willie Huston'),
('5771', 'Hi, I writing to check the status of my giving statement.  I filled out the form on-line the 1st week in January??  I attend the 11am service and can pick it up after service, please advise.  Thank you.'),
('5800', 'Hello!\r\nWe are looking for volunteers for an upcoming event on March 3rd-7th.  We would love for you to participate!  The information for our Fixing up the Neighborhood (FUN) event follows.  Hope to see you there!!\r\n\r\nHelp Habitat for Humanity of Greater Orlando Area paint and clean up the Meadowbrook Acres community! Monday, March 3rd through Friday, March 7th we are Fixing Up the Neighborhood and painting 22 homes! Habitat Greater Orlando, in partnership with Orange County is providing 22 homeowners in the Meadowbrook Acres community (link for directions http://bit.ly/1bcBxtq) an opportunity to receive minor exterior home repair and painting.  We are looking for 90 volunteers per day to assist with improving this neighborhood.  We will work from 8am-2pm each day.  Minimum age to volunteer is 16.\r\n\r\nPlease sign up and help us spread the word, groups are welcome!  \r\n\r\nTo register contact Jennifer Gallagher jgallagher@habtiat-orlando.org or 407-440-6979.\r\n\r\nThank you!!!\r\nJennifer \r\n\r\nJennifer Gallagher, Director of Community Outreach\r\nHabitat for Humanity of Greater Orlando Area Inc.\r\n4116 Silver Star Rd. Orlando, FL 32808 MAP\r\nP) 407-648-4567 ext. 207 F) 407-648-4450 Direct) 407-440-6979  \r\n\r\n '),
('5827', 'HEARD THE PASTOR SAY HE WAS TOUCHABLE. as of late the more i know, listen learn the more legit christians confuse me. ill wait to see if im heard first. but to start im enguaged to a married woman im 56 disabled and wont be getting well, ive gone thru the traps of adultrys. lies damsels in distress. bait n switches and tho sincere the curses came.i was so far down n life. i trusted no one but i do hear gods voice. i met a mothjer of two fine grown children. so emotionaly abused by a false christian husband for 22 years. who had to leave the man, he literally drove her into breakdown sher children family agreed. he is well off, she works hard grooming pets. she had given up on love and just dated. sex apart from him for two years. he,s got the home everything. he has 2 girlfreinds makes 60 k a year. and will not let her go because. his credit is bad and cant get a loan to take over payments. i refused sex b4 marriage. fell at times but im very troubled. she moved into my mess a good woman with tough wounds scars. sex was my only selling point. we have many issues trust worth ect. but without a dougbt love, a deeper godly desire lives in this house. we long to get married long for thenintamacy. but we live dammed if we do or dont for over a year. we just do not have the money or info to move on. to get married live our days closer to christ. trapped by greed laws and convictions our fears ect torment us and my health wont be getting better. this is not the mistake of the past truth its a miracle that weve obstaind this long. and we both fear the ways satans working against us we study prey hear it alladd on the confusions of prior divorces is there no one out there who helps. has advice beyond, pay or forget it were simple folk live in old wore out house. medical needs uncle sam lied.we would just love to get on with life god. fill our purpose i love her very much and god knows her limit for god. for us to do right. is s clear as is mine help us please.thank you god bless. we enjoy r morning sermons');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('5868', 'The past few days I\'ve tried to give my tithes and offerings online but it hasn\'t been working properly. The \"processing please wait\" tab just actively displays for several minutes but it doesn\'t go through. I\'ve given online through the website before without any issue.\r\n'),
('5933', 'Pastor Marvin, \r\nPlease read Ezekiel 18 concerning our iniquities as individuals must be dealt with as such according to YHWH/GOD\'S word??? There are no generational curses, because CHRIST died on the cross for all SIN, which includes curses, iniquities, wickedness, to those who ask for FORGIVENESS!!!\r\n\r\nBrother Huston'),
('5998', 'To whom this may concern:\r\n\r\nThis is a request for my 2013 giving statement. If possible, would I be able to receive my statement on Wednesday night before or after bible study? \r\n\r\nThank you in advance, \r\nMicaella Glenn'),
('6014', '6 AM SERVICE GOODLIFE 45 OUR PAST SINS, EXPERIENCE, GOD USING. SUFFERINGS IN FUTURE PASTORS PAST. EXPERIECE TORMENT FROM OTHER, BETTER COUNSELORS LIFE OF JESUS SORROWS PERSECUTIONS TEST ECT, GOTTA FIND SERMON GOTTA GET DVD, GOTTA GET  SHOW. PLEASE HELP. ITS MEN ITS OTHERS IT CON CONFIRS MY NOW. PLEASE PLEASSE.. SERMOM PLEASE DVD OF PASTORS PAST, MY PAST. SEEN B 4. HIT THE MOMOMEMT OF NOW. CONFERMERMD EX PERIECE BAD GOD USED 4 GOOD 10 II. PLEASE NOW MISSED SERMON.'),
('6027', 'My Fiance and I are planning a wedding for (September 6 2014), and we are both members at the River. I Spoke with administration and was advised that I can be put on the church calendar for the wedding. You can give me a call back at my number any time. Thank you.'),
('6038', 'Our son Javion was born May 13, 2014, prematurely, after a very challenging ad uncertain pregnancy. Through Gods wonderful grace and mercy on our lives, our son is happy healthy and approaching his 1st birthday. \r\n\r\nI would be a blessing and an honor to have him blessed and dedicated at ROLCC, during the beginning stages of his life I began watching this ministry broadcast each morning, and my life has been forever changed. \r\n\r\nI look forward to speaking with someone. \r\n\r\nThank you \r\nPatsy Beckett \r\n407-880-9647 home\r\n321-441-6197 cell '),
('6050', 'I want to be saved and let God guide me and teach me how to love myself, forgive my past, and walk the path that he have planned for me in the present and the future. I want to tell and teach  other people about his word and his miracles. '),
('6181', 'april 10 2014 6,30 am. pastors message, wearing a white blazer, in chair hurt foot. sermon ups downs do,s dont per marriage. tho often kinda redundant yet not re runs, on good life 45 tv.  i would beg of you, how to find this sermon, copy it, send it find it. and it is urgent all around. most often none to say i get ignored, my requests, pastor is great to admit it attacks us all, i could go on to the real disaster and evil devastations ive live, others. ill stop. im computor illiterate, and in my searches,  I GET IGNORED, YOU HAVE MY EMAIL, PHONE NUMBER, TO DATE SOME OF THE BEST PREACHERS, SIMPLY IGNORE ME, AND JUST ME A FALLIN SOUL, TRICKED. AM URGENT FOR ALL THE HELP I CAN GET, THIS IS ONE SERMON.. HOW CAN I GET IT, CAN SOMEONE SEND IT TI ME, PLEASE, GOD BLESS AND THANK YOU., PASTOR AND CREW. KELLY R DOUGHERTY. DB FL'),
('6233', 'Good morning! I would like to schedule an appointment with  Pastor Deborah and Pastor Marvin if possible. Phone call or email is sufficient as I don\'t have transportation to the church. I am in dire need of guidance and am having trouble hearing and knowing what the Lord wants me to do. This isn\'t about a relationship with a man either, far more important. Thank you and please relay this message. It would be an honor to speak to them at the same time but if either of them even have the time to call or email it would be super. Thank you so much!'),
('6239', 'I will try to keep this short for the sake of reading although my feelings on this topic run deep and there\'s so much more I could say.\r\nI have been attended ROLCC for the past 2 years now and during this time have experienced life changing events, evolving from a newly wed to a First time Mom of now a 1 year old son.\r\nIm confident that the children ministry at ROLCC is great just like all other departments I have encountered, and fully aware that my child is welcome to attend. However I am not ready for this separation at this time. I actually feel a greater blessing being able to worship with my child and a peace knowing hes with me.\r\n**I no longer feel welcome to attend service with my Son due to the risk of him making noise that may jeopardize filming. Or run the risk of being asked to leave because he still doesnt understand that it is not appropriate to clap and cheer when pastors preaching. \r\nSo I have been forced to find a church with a family room where I can worship with my child.\r\nUnfortunately this just doesnt seem right and I feel like Im being drained spiritually going through the motions of being in church but not feeling part if it. Im no longer growing the way I felt I could at ROLCC as the word isnt delivered in a way I can understand, relate or feel the anointing.\r\nSpeaking with fellow Moms from various church\'s, I know Im not alone and fear that I will soon become one of the majority that no longer go to church due to this situation.\r\nThe church I once whole hearted wanted to become a member of, that I felt provided the spiritually teaching and growth has turned its back on me without even knowing.\r\nSo I write to you in hope today that this will be turned around. In hope that a solution can be found for Parents to worship together in church with their small children without disrupting service.\r\nI dont have all the answers but would be willing to discuss this further so please feel free to call or email me to discuss this opportunity.\r\n\r\nRegards\r\nMrs Makeda Bush.');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('6339', 'Greetings, \r\n\r\nI wanted to know if vendors are welcome at your event I would love to set up a display table for  your Mother\'s Day Luncheon.\r\n\r\nCynthia Davis\r\nCEO and President\r\n\r\nwww.jewelrybyvaleriesarrow.com\r\ninfo@jewelrybyvaleriesarrow.com\r\nOffice:407.346.2821'),
('6408', 'Take a look at your circle....it effects you one way or another. Our environment effects us ....it operates in it\'s self.....do you see baking power in the ball of dough you mixed together. It is insidious and it can be a wrong mix which will be effect you or just what the recipe called for. For good or bad! \r\nProverbs 13: 20 control who you hang out with. We must define our relationships ....talking about things we don\'t want to hear or be a part of. Build your environment ...1 ex.  One who is extravagant can influence our life...we start dressing, acting and talking like them.  2nd ex one who is humble , kind and loving....this will influence me. Now we need to choose ( 1Cor. 5: 6)\r\nWho we hang out...develops your character...make a decision to control your environment .Heb12:15 do not let any root of bitterness rise up among you.....a bitter person is a hurt person that has gone through a negative situation. They will try to pull you with them....Down beneath the ground like a root that is not seen,but does not grow to produce fruit like a bruise that can be covered. Make a covenant with your eyes and ears , don\'t look or listen to anything that would defile you.....two important gates (eye and ear)you need to protect. Control your environment....  Things that stink get rid of the trash... The hand that rocks the cradle rules the world....the mother! \r\n Rebekah, Delilah, Jezebel ....caused others to loose their power.  Hated the prophet which was the voice of God. Horodias...arranged for her daughter to dance for The King in order to get the head of John the Baptist Herod liked John but the influence of the dancer made him to do evil.'),
('6430', 'After attending several choir rehearsals, I was told to download an app from the \"planning center\". I am unsure if this is the correct format. I cannot find it anywhere.\r\nI am looking for news and information for new choir members.'),
('6456', 'Our little one is 7months and we would love to have Pastor facilitate his christening. We have been attending for over a year(tithing), & have recently became official  members. We look forward to hearing back from you all.'),
('6461', 'Dear friends,\r\n\r\nGreetings to you in the name of our Lord and savior Jesus Christ.\r\n\r\nI am apostle Achwera from Uganda, east Africa. I have serves as an apostle and the local church pastor for over 12 years in the ministry now.\r\n\r\nWith concern, I would like to join hands with you and work together under the same umbrella of your ministry in Uganda with your same name as  part of you.\r\n\r\nPlease, give me some light toward my request. I shall be grateful to hear from you toward my request.\r\n\r\nThanks and may God bless you dearly.\r\n\r\nYours in Christ,\r\n\r\nApostle Robert Achwera\r\n'),
('6526', 'We would like to make sure we continue to receive the phone announcements that are sent by The River or any other pertinent contact needed, so here is our updated home phone number: 407-822-5450.\r\n\r\nThank you.'),
('6538', 'We here at Monkey Joe\'s are getting super excited for the summer!  We are currently booking reservations for the summer!  We have multiple options for 15+ kids, as well as some options for 6-14 kids! We hope you will consider visiting Monkey Joe\'s this summer for a bouncing good time.  If you have any questions, concerns, or would like to book a date/time, please respond to this e-mail address and we can get your reservation in ASAP!  The advantage to booking a reservation in advance is that you guarantee your group\'s entry into Monkey Joe\'s at a discounted rate!  We also do not require any deposit to book a group reservation! We have 2 locations, Winter Park and International Drive (inside Pointe Orlando). We hope to hear from you soon!'),
('6554', 'Diligently needing assistance with my rent. Transportation temporarily limited due to excessive repairs to an high mileaged car which di dnt mske it through final repairs. In a disposition in hopes of your understanding. I only need the other poetion of my rent of 600.00 I have 300 only. Please call me or landlord below to help with this assistance. My contact info is 407-462-5879. Ms Kelly. I owe my landlord the amount of $600. Your helps greatly appreciated! :)\r\nMy landlords contact info: 407-844-7996 Mr Mok Djermani. 1751 Hotel Plaza Blvd, Orlando Florida 32830.\r\nReasons for loss of inability to pay in full this month, utility,  phone (much necessity for my work assignments), major car repairs)'),
('6560', 'Diligently needing assistance with my rent. Transportation temporarily limited due to excessive repairs to an high mileaged car which di dnt mske it through final repairs. In a disposition in hopes of your understanding. I only need the other poetion of my rent of 600.00 I have 300 only. Please call me or landlord below to help with this assistance. My contact info is 407-462-5879. Ms Kelly. I owe my landlord the amount of $600. Your helps greatly appreciated! :)\r\nMy landlords contact info: 407-844-7996 Mr Mok Djermani. 1751 Hotel Plaza Blvd, Orlando Florida 32830.\r\nReasons for loss of inability to pay in full this month, utility,  phone (much necessity for my work assignments), major car repairs)'),
('6566', 'Good morning I\'m trying to attend your church & was wondering if you had a church van or mini bus that collect members on the way to church for services. My children & I live within a 2mile radius if that matters.\r\nThanks.');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('6591', 'Hello, My name is Ileana aka Lyllii. Eight months ago I accepted Christ into my heart. When I became a christian searched to know more of GOD and how to become closer to Him. I thank GOD for River Of Life Christian Center, Pastor Deborah and Marvin Jackson because throught their teachings I am understanding and in joy of my new life in Christ. I have visited the church several times and each of my visits have been an amazing experience. I would love to become a member of the church and receive baptism. Please contact me soon on went there will be baptism and what can I do to be a part of the services. Thank you so much and may GOD continue to bless the River Of Life Pastors, Ministries and all the members of the church whom have been so gracious to me.  '),
('6614', 'I have been a member of the River of life Christian Center for approximately one year.  My fiance\' and I are getting married in Montego Bay, Jamaica on November 16, 2014 and we are interested in receiving pre-marital counseling with Pastor Marvin and Deborah Jackson at their earliest convenience.   \r\n\r\nPlease feel free to contact me at the above stated number any time.  We look forward to hearing from you.\r\n\r\nThank you for your attention to this matter. \r\n\r\nWarm Regards,\r\n\r\nTheresa Phillips'),
('6655', 'Hello\r\nMy wife and I are looking for a good home. I\'m a musician (Drummer) and I have playing for about 20 Years. Currently I have been playing at Discovery Church. We\'ve been wanting to stop by as we live right around the corner. Would love to speak with someone.\r\nTake care!\r\nKevin Weakley\r\n\r\n'),
('6662', 'Hello\r\nMy wife and I are looking for a good home. I\'m a musician (Drummer) and I have playing for about 20 Years. Currently I have been playing at Discovery Church. We\'ve been wanting to stop by as we live right around the corner. Would love to speak with someone.\r\nTake care!\r\nKevin Weakley\r\n\r\n'),
('6668', 'I am currently searching for a new church.  I went to Joel Osteen\'s site and your church was recommended.  \r\n\r\nI have been struggling financially.  My position was eliminated and now my unemployment benefits have run out.  I was wondering if River of Life Christian Center offers benevolence.  I need help with my utility bill this month.  \r\n\r\nThanks very much,\r\n\r\nKathleen '),
('6679', 'Hello, \r\nMy name is Venecia Jenkins. I am a member of the church and I am getting married next year in April. I wanted to inquire about Pastor Marvin Jackson\'s availability for April 11, 2015 to be the officiant at our wedding. Also want to know what would be the included fees. Thanks in advance! Have a wonderful blessed day!\r\n\r\nVenecia'),
('6684', 'Dear Pastor Jackson,\r\n\r\nI don\'t have a home church or family here in Central Florida. I\'m in need of guidance and don\'t have anywhere or anyone to turn too.... It\'s because of my young teenage daughter I\'m sending you this email. She means the world to me....and she deserves the very best I known God will give her....I\'ve made mistates and I take full responsibility for it all, but not at the risk of my daughter\'s happiness and spiritual growth. I\'ve reached a place in life I literary have nowhere else to turn for help...I know God is with me....it\'s because of Him we\'ve made this far and I thank Him each day for His strength carries us both...but now I believe it\'s time for me to reach out....please, please, please can I make an appointment to talk with you and/or Mrs. Jackson at your earliest convenience?! I\'m not in need of money... incase you\'re wondering.... God has blessed me with an income (I\'m employed now) I would gladly pay for your time (no more than just a few minutes I know you\'re busy with more important work) but I need help..... we need help....please don\'t turn us away!\r\n\r\nI thank you in advance for your time and consideration. I look forward to hearing from you soon.\r\n\r\nI pray that our Lord continues to guide, keep and bless you, your loved ones and congregation. \r\nBlessings,\r\n\r\nNora\r\n\r\n\r\n'),
('6775', 'Take notes here, then email them to yourself by clicking below.\r\nGod will speak to you about people place thing\r\nlearn to hear his voice. speaking about itching ears- would rather hear things that make you feel good. God dosent always say what u want to hear \r\npsalm 119 the word must be precious if i am going to hear God and understand his voice\r\nyou must attend to the word.  God wakes you up early to speak to you. \r\nthat i must meditate on thy word.  proximity has a lot to do with what you hear. \r\nhave a church full of people and preachers that don\'t know God. Because if we knew God somethings we would not do. The entrance of thy word gives us light --- God\'s word has to be revealed to you. Light always pushes darkness back & allows visibility. The word of God is so powerful it will let you see behind the scenes. You haven\'t received revelation until there is a change in your behavior . Revealation is what changes your mind. That information is upernaturlal advantage over what the devil is trying to do to you. revelation cause you to see thing that people try to hide. The Lord will speak to you about the thing first. When he sends someone else its because you sitting on the fence\r\n\r\n\r\nEverything prefaced by thus sayeth the Lord, do you know that the devil can speak to, the things that make God divine omnipresent, omnopent. but he has an awesome communication network, but he can work with what you day. Pray in your prayer language. when you are engaged in a battle, be careful. \r\n\r\nJohn chapter 10= My sheep they hear me, Gods instructions are not confusing, he doesn\'t play head games. Once have a spoken, twice have i heard thee. '),
('6796', 'I\'m a graduated MA student with my own apartment and need your guidance, financial help, woth only one month of my rent. I didn\'t have the full dental coverage I needed now I do. I truly do need you help with only my July rent. My landlord will take a check. Please mail any documents ill need to apply because I don\'t drive at the moment. Or feel free to visit me. I owe my landlord 850.00, as much as you can possibly assist with is a blessing, \r\nThank you,\r\n\r\nSiera Kelly\r\n407-952-8111'),
('7164', 'Good morning! A couple of weeks ago at the 11am service Pastor had altar call for different areas in our lives to come up for prayer.  He also had the congregation raise their hands for prayer if they needed major repairs on their cars and couldn\'t afford to pay for it.  I raised my hand and after service a lovely couple came up to me and told me they wanted to pay for my repair. A week later(Saturday) I took my car to their mechanic and had a new radiator installed.  Within a couple of hours the car was leaking antifreeze.  Monday morning I called the mechanic and took the car back to him, he examined the car and told me it wasn\'t the radiator but my water pump and that it needed to be replaced or I would damage the engine/radiator.  I told him to replace it which costed me 250.00.  I used money that was to go toward my rent.  My question first of all is when God blesses you isn\'t it a perfect blessing? I\'m so grateful that God used this couple to bless me and so quickly but I\'m still having problems with the car.  It\'s leaking again and now when I start it up it\'s making a grinding sound.  I don\'t want Damu and Dennis to think I had money to pay for the car when in fact I used money that was allotted for my rent and I haven\'t replaced yet, I don\'t want them to think I\'m telling them so that they can fix something else on my car and finally I can\'t afford to take my car to the mechanic and have him tell me something else needs repair.  I know I found favor with God through Damu and Dennis and I\'ve thanked and praised God for that and for them.   My confusion is God is perfect and does everything in order, this is so out of order would you please give me a word of understanding?  A scripture anything to help me do what he would have me to do?  And I have prayed and asked God for direction and my answer was to seek Godly advice.  Thank you so very much,  yours truly in Christ.  Verlinda Cheek');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('7165', '[What to do when you don\'t know what to do] 2 chronicles ch. 20\r\nProblems Promises and Patients \r\nEach problem brings growth and spiritual growth with god\r\ncount it all joy (James)\r\nyou are an overcomer\r\ngod has enabled you to win every battle\r\ngreater is he that is in you then he that is in the world \r\nyou are the head and not the tail you supposed to live above your situation\r\n\"Im a Winner\"\r\nwhat to do when you get ambushed by life problems \r\nyou don\'t have to be doing bad  for bad things to happen to you \r\njust cause bad things happen to us don\'t mean there bad people\r\ntrouble is a set up for the glory of god if god allows it to happen to you its made to help you become better.\r\n(what do you look to when the trouble comes) I will keep him in perfect peace who mind is stayed on me.\r\nphil. ch2 be anxious for nothing but let your request be made unto god and the peace of god will keep your heart.\r\nAll things work together for your good.\r\nyou can praise god for the victory even in the fight that seems like your losing,\r\ngod will give instruction before you receive your miracle.....you will be tested \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n\r\n \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n'),
('7189', 'I am asking for prayer for my friend\'s mother, Annie Robinson.  Praise God she did not have any strokes!!!   She is in the hospital and the doctors are running tests to see if she has an infection or cancer that may have spread to her brain.  Thank you for your agreement in prayer for healing.  You can also reach me at 407-579-2541.'),
('7203', 'Urgent Confidential and Anonymous Prayer Request: During summer, young child  has to go on an extremely long extended visitation with the father. Child says the father looks and acts very weird and circles his finger around by side of head as if saying the father is crazy. Child has fears and anxiety because feels has no control in making decisions about not wanting to go on visitations because the father won\'t listen. The child is extremely nervous, biting nails, hands shaky and in a fist and cries sometimes saying that it is because of the visitations. The child\'s teacher said that the child is displaying some anger now. For the child\'s sake, we cannot tell the child what the father is all about and the things that the father is involved in. We keep praying that the man will fall into his own trickery lies and crafty snares that he tries to set for us and that he will get caught in the stuff he is involved in without any harm to the child physically, mentally, emotionally or spiritually and will let the child have his wishes about what does or doesn\'t want about visitation and for the summer and other visitations to be very minimal. He never pays support but makes demands. The child and my daughter need prayer for a great hedge of protection around them for their protection from this man and for no long or frequent visitations for the child\'s stability in life. The child loves Jesus and is born again. The child prays every night that the visits will stop and wonders why Jesus makes the visits happen. Please pray in agreement with us for a miracle for this dear child before the summer visitation and for other children that don\'t want their visits either. Thank you so much for your prayers of help! May God be the glory in all of this! God bless you all!'),
('7215', '2nd Samuel: Ch.7v12-17 [Releasing Your Faith GENERATION BLESSING]\r\nDavid was a man after gods own heart\r\nyou have to desire to put god first\r\nleave a legacy of Faith, Faithfulness, and Commitment \r\n2nd Timothy: ch.1v3-6\r\nFaithfulness: Being committed  \r\nGen Ch.28v10-17 \r\nRealization: what you don\'t realize you cant maximize \"watch out for distraction\" capitalize on gods moving moments.\r\nyou cant die until the word of god is fulfilled in your life\r\nLuke Ch5v17-26\r\nIt hurt god when you don\'t realize his power and who he is\r\nJohn Ch.4\r\nThere is no area in your life you cant allow god to fix \r\nEX:the women at the well she almost missed a chance with god\r\nrealization has to do with the moment in time where your able to comprehend and awareness of the moment with god \r\n{Scriptural revelation} \r\nDeut.ch 30v19\r\nLamentation ch5v7\r\nthe blessing is supposed to make you able to live above the curse of the world \r\nexodus ch20v5-6\r\nbe careful what and who you bring in your house\r\nwe are free from the curse but not from the curse of the world \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n'),
('7233', 'What kind of world would God make? Made a \"paradise\" for Adam and Eve. World was so lush and plush, everything they wanted was within arms reach. No need for rain in a perfect creation. Rain didn\'t come until Noah. Work was supposed to be fullfillment, not dreadful. God only gave him one restriction, do not eat of the tree of Good and Evil. Eve touches it and everything begins to turn inward.\r\nCurse carries a two fold meaning. The blessing was turned inside out. Satan has entered into the earth. We don\'t know how to tap into the blessing. the power of the blessing helps us live in a cursed environment. Access the blessing! The wealthy preacher is connected with the \'bad person\'. God is trying to teach about where our rghtful place is in the earth. blessed when we go out and when we come in. we do not know how to access the blessing.\r\nRomans 5:17-19 For as by one man\'s disobedience many were made sinners, so by the obedience of one shall many be made righteous.\r\n\r\nGenesis 3: 9-24. We should want to hear God\'s voice. Righteousness does not run from righteousness, it runs toward it. Evill communication corrupts good manners.  The seed of the woman is only present in Genesis. Jesus makes a promise of redemption. He made a way for him to walk back in dominion agian. Women\'s desire is unto their husband, and they will continue to have children. This is a part of the cursed earth. Now the earth is cursed, and we have to work for the jewels and gems to get them. We are not cursed, we live in a cursed earth!\r\nGalations 3:11. The curse is broken. Why yoke people up and put them into bondage when Jesus has freed them from it. Jesus reached it and fullfilled it. Now we are not cursed, we are blessed. Walking inthe authority taken away from me in the Garden of Eden. I\'m supposed to be above and not beneath. I don\'t have to try anymore, I just have to put on the robe of righeousness and live the way God wanted me to live.\r\n\r\nDeuteronomy 21:22-23. How can you be the Messiah, when people die this was they are supposed to be cursed. So when Jesus was hanging there, he was cursed because he was taking the curse off of his people. So when we get saved, the curse of sin and death is no longer upon us.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n'),
('7283', 'To Whom It May Concern:\r\n\r\nI am seeking work in financing, human resources, administration, or any place I can be of service. I have over 10 years experience and have received training from University of Phoenix. I am also currently an Educator and have experience with children from 6-12th grade and college. In addition, I have experience dealing with individuals with special needs. Please at your earliest convenience, contact me. Thank you for your time and convenience.\r\n\r\nSincerely,\r\nShelley Holston'),
('7426', 'I have done clerical work in my past and also I have attended services at river of life.  I would just like to be given the opportunity to work for this church and also I\'m an employee of pinnacle security services in which Jim Randle also provides security services for the church. '),
('7526', 'Hello,\r\n\r\nI am inquiring about private marriage counseling. I am not a member of an Orlando church I am a member of a church in Houston,Tx. I have been attending a local church here in Orlando paying my tithe at this  with my children. My husband no longer attends church but has agreed to attend private counseling. I would seek help within the church I have been attending however my husband is not going to agree to that. This my last option for I have grown very weary.. Please let me know if private marriage counseling is available. I did call your church to inquire but was unsuccessful.. Thank you for your reply'),
('7601', 'Good afternoon, Pastor Jackson & Dr. Deborah Jackson:\r\n\r\nPlease, first allow me to thank you again for the financial assistance that we received a few months ago from the ministry. Relocating to the Central Florida area was met with a lot of challenges, but your help allowed us to pay our rent for that month and to keep things moving forward. Please thank Ms. Celia as well for handling the transaction with us and being one of the most loving human beings this side of glory.\r\n\r\nI just completed a Master of Science degree in Entertainment Business from Full Sail University and my wife and I are in process of launching our entertainment business down here in Orlando, FL. We have been members of The River now for about 11 months and are not making any plans to go anywhere else. Our business is Christian \"edutainment\": education with entertainment; and we are in process of putting together our first live event family leadership conference for summer of 2015. Here is a link to our website: www.breathe150entertainment.com. (Please bear with us as our website is still under development.)\r\n\r\nWe believe in having pastoral covering over our business and also believe in tithing out of our business profits. My wife and I would love to have the chance to sit down with you to present to you both our business plan. We are putting together our board of directors and leaders now and would like to officially ask you to be two of the members of it and to also be our pastoral covering. Within the next couple of weeks, we will be moving into corporate and crowd funding initiatives and are making sure that all of our state and federal documents are in order. There\'s so much to be done, and with us still being fairly new to the area, we need to make a number of connections fairly quickly. We hope to work with other credible business leaders from The River if we determine a healthy business relationship can be fostered without tarnishing a church family bound when it comes time to make tough decisions.\r\n\r\nOn a personal note, we really don\'t want our business (and pastoral covering relationship) to get in the way of our healing and growth at the River of Life. Though we hope to work with some talented members, we are in no way trying to go start another ministry or take people away from their call at the River of Life Church. We would love to simply enjoy worshipping at the ministry for the rest of our lives, raising our children, helping the ministry to continue to grow from our support, and to not get in the way of what the River has been called to do by our Lord and Savior. Along with our other board members, we would like to submit to complete accountability through the lenses of the grace of God and, if necessary, receive appropriate rebuke if there is apart of our private lives that need to be corrected. We hope you will be willing to join with us as we venture into this new season of our lives. I\'ve attached links below to our Linkedin page to give you both a brief background of our previous work and education experiences. Please feel free to contact us and we look forward to meeting with you. Thank you and God bless. \r\n      \r\nRyan Council\r\nPresident & Founder of Breathe 150 Entertainment\r\nryan@breathe150entertainment.com / ryanrcou@hotmail.com\r\nhttp://www.linkedin.com/pub/ryan-council/2a/a87/9b5/\r\n407-347-5871 / 757-339-7965\r\n\r\nTracey Council, Ph.D.\r\nExecutive Director of Breathe 150 Entertainment\r\nhttp://www.linkedin.com/pub/tracey-council/70/535/87b\r\ntraceycouncil@breathe150entertainment.com / travalty@hotmail.com\r\n407-347-5871 / 757-277-1357'),
