t comes time to make tough decisions.\r\n\r\nOn a personal note, we really don\'t want our business (and pastoral covering relationship) to get in the way of our healing and growth at the River of Life. Though we hope to work with some talented members, we are in no way trying to go start another ministry or take people away from their call at the River of Life Church. We would love to simply enjoy worshipping at the ministry for the rest of our lives, raising our children, helping the ministry to continue to grow from our support, and to not get in the way of what the River has been called to do by our Lord and Savior. Along with our other board members, we would like to submit to complete accountability through the lenses of the grace of God and, if necessary, receive appropriate rebuke if there is apart of our private lives that need to be corrected. We hope you will be willing to join with us as we venture into this new season of our lives. I\'ve attached links below to our Linkedin page to give you both a brief background of our previous work and education experiences. Please feel free to contact us and we look forward to meeting with you. Thank you and God bless. \r\n      \r\nRyan Council\r\nPresident & Founder of Breathe 150 Entertainment\r\nryan@breathe150entertainment.com / ryanrcou@hotmail.com\r\nhttp://www.linkedin.com/pub/ryan-council/2a/a87/9b5/\r\n407-347-5871 / 757-339-7965\r\n\r\nTracey Council, Ph.D.\r\nExecutive Director of Breathe 150 Entertainment\r\nhttp://www.linkedin.com/pub/tracey-council/70/535/87b\r\ntraceycouncil@breathe150entertainment.com / travalty@hotmail.com\r\n407-347-5871 / 757-277-1357');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('7649', 'I just would like to thank River of life for welcoming me in with open arms, My name is Whitney Mathis I am the mother Of Mahogany and Zion I was invited by my god mother and since then I have continued to come not just for her inviting  me but because of the personal relationship Me and our God has as he speaks confirmation through now my pastor, Pastor Jackson. Soon as I step in the church I just knew this is where I needed to be, I have been to many churches which each one I came out with something from God but still couldn\'t settle there until I came to river of life which God just spoke through worship services and also through Pastor the time is now you settle here because you have work to do. I am now walking in my healing and seeking after Gods heart and his will so where he place me I will go, What ever my calling is that I don\'t understand as of Now But I will do I say all to say ,The time is now where I have step out on faith with my wings spread out to do what God Has called me to do. And it will not only be in the church but also in the community that I will win others to Christ because its not only about me its about Shining my life that 1,2,3, or more be saved. Please keep me, my kids, and also my family in everyone prayers. Amen'),
('7673', 'My Question is What does it mean to give to GOD as far as 10% , How do i give to GOD? What does that mean?\r\nDo I give the 10% to the Church Only or do i use that 10% for Both the Church & Charities \r\n\r\nThanks'),
('7736', 'My child (son) joined church today and would like to be baptized on August 27th. Please advise if he will be able to baptized. My son spoke Dr. Jackson and he said he would baptize my son. Please advise.\r\n\r\nGod bless \r\nRhonda Cooper'),
('7829', 'I am a Christian and a mental health counselor who is registered with the state of Florida; which means I am working on meeting my 1500 hours towards licensure.  I already achieved the masters degree in counseling back in 2011.  Long story short, ever since I graduated I have been running into road block after road block when applying to various agencies to complete my clinical hours.  I just could not get a job as a counselor.  I finally land a job at a counseling agency that had me doing 60% psychoeducation and 40% psychotherapy.  Well, psychotherapy is what is observed by the state towards licensure hours.  Knowing that;  I took the job anyway with a mutual understanding that a clinical supervisor would supervise me and sign off on my psychotherapy hours; which amounted to 1000 hours.  However, as time went on the agency did not honor their part of the deal (because the clinical supervisor later stated that he was too busy to clinically supervise me) so I found myself stuck in a position where none of my work hours counted towards licensure.   In otherwords, I just threw away 1000 hours.   After one year I applied elsewhere for a counseling position.  I got the job and the lady put it in writing that she would be my clinical supervisor.  That made me happy.  So as weeks and months went on; the clinical supervisor starting becoming very bias towards me, she started sending me nice, nasty emails about what I better do, she started micro managing my every move and when another employee told a lie on me; she just assumed what the employee said was true and never once asked me.  When the truth finally came out; she made justification and rationale for why the employee would say that; instead of admonishing the employee and apologizing to me.  After 6 months of this treatment; I asked to speak with her to address my concerns.  I was very professional and calm.  She became very belligerent and just took what I said to the next level by drawing her own conclusions.  Finally, she stated that I had a choice of being terminated or I could just resign on the spot.  I tried to get her to listen to reason; but to no avail she would not; so unfortunately I had to resign 8/20/2014.  Of course, I am back out there looking for that counseling job once again; but I feel horrible!  I got an on the spot interview with another agency this morning; however, after this good hour and a half interview; the lady wanted to call the job I just had to resign from.  I was honest and told her about the situation, but she still wanted to call the job for a reference.   So of course, that does not make me feel any better.   I am counselor, but I can\'t seem to help myself.  I got the degree, but it seems as though the enemy is fighting me on every hand when it comes to getting those counseling hours towards licensure.   I know this was a little long; but I had to paint the picture.  PLEASE PRAY FOR ME!  I feel like I am having this horrible nightmare and can\'t seem to wake up.   I have no clue as to what is going on; because I am just not understanding.   I Thank YOU for your time and prayers.    Linda B.   :)   If you choose to call; between call between these times  9 am and 7 pm.  I thank you again!'),
('7853', 'The devil attacks those that are passionate seeking Christ not the lazy ones.\r\n\r\nDiscouragement starts mentally before it appears physically. Don\'t quit because someone is depending on you.\r\n\r\nPeter rebuked many times by Jesus.  The discouragements kept him afar. He denied Jesus 3 times and ran rather than overcome to fulfill the purpose God had for him.\r\n\r\nMatthew 16:21-22\r\nJohn 18:10\r\nLuke 22:54\r\nJonah 2:7-10\r\n\r\nALWAYS Pray. Don\'t stop praying. Remain steadfast, feel tired; do it anyway. \r\nKeep on serving. Keep on doing the right thing.\r\n\r\nHebrew 10:35\r\n\r\nDONT GIVE UP!\r\n\r\nPRAISE YOUR WAY OUT OF YOUR PREDICAMENT\r\n\r\n'),
('7866', 'Dear Pastor, \r\n   My family and I are new to the neighborhood and attended your church  for the last two Sundays and enjoyed your services much.  We have gone thru a strong trial and have been looking for encouraging words. My spouse  and I  literally just moved to a new apt happy that a door finally opened for us after literally being homeless  with the  kids going  now that we moved I lost my job which hit us out of no where it was our only income now we are just praying that I find a job asap to continue income for rent and food we have no transportation we literally have been hitting rock bottom. We heard your service of not quiting and keep fighting because God knows I\'ve been wanting to give up on everything because things just been spiraling down a stair way with no way to stop. Please keep praying for us I have interviews this week in hopes of having income again for this coming month rent Praying for open doors and our life to stabilize and stand firm in faith. Thank you I\'m a chef with associates in culinary arts if any work you know of please inform me will greatly appreciate it..'),
('7877', 'Prayer for Elena\r\n\r\nPrayer for financial breakthrough\r\nGod will supply all your need according to his riches in glory.\r\nGod confirmed His Word to deliver us, revitalize and strengthen the Word for the glory of God.\r\nThank you very much!\r\nGod bless you!'),
('7910', 'There are some things God tries to kill in you but you won\'t let it die. \r\nYou have to decrease to increase.\r\nGod designed you to be in a crushing situation to lift you.\r\nPraise Him in the storm. \r\nEveryone will have crushing moments but we need to prevail and find our  inner peace deep inside.\r\n The storm will be around. It did not disappear but it is in retreating to our peaceful place that we state that God has this.\r\n Don\'t stress, worry, get anxious. Be in peace and wait for change to come. \r\nWe have an appointed time for our storms to end.\r\nChange is on its way!\r\nYou are an overcomer!\r\nGod does not let anything happens that He has not designed.\r\nThe devil had to ask God permission to test Job'),
('7912', '2 Cornthians 4: 7-10;16-18\r\nThe Over-comers Mindset:\r\n~people that are victorious, weather the storm, ppl who see there season change & their turnaround manifest, they think a certain way. \r\n~We are not to be conformed of this world, but their are transforming power in the word of God.\r\nTornado Alley ?\'s\r\n1. Why would you build a house in an area that is designated as tornado alley?\r\n2. Why rebuild, if destroyed in the area?\r\n~Something in the child of god that causes us to BOUNCE BACK from adversity; try again.\r\n~Don\'t allow ONE bad situation to take you OUT.\r\n~The spirit of an over-comer is on the inside of you.\r\n~We will always WIN\r\n~More Than A Conqueror\r\n~Hold On TO god\'s Unchanging Hand, wait, and watch god Do what he is going to do in you life.\r\n~Key to Winning is Outlasting, Do not FIGHT with it, nor struggle with it, Roll With It. Trust in God to Deliver you.\r\n~The reason you are tired and spiritually exhausted, is b/c you are fighting a battle that God NEVER intended you to fight\r\n2 Kings 7:3-7\r\n2 Cor Passage Reading\r\n-Outward Man vs Inward Man\r\n-outward perishes and Inward renews\r\n~\"Light\" affliction: what you are going thru is working \"FOR\" you.\r\n~There are some areas of spiritual grow & maturity that you will NEVER grow in & mature in unless you go thru certain situations. It is God\'s will that we grow & develop. And we cannot do these thing, spiritual muscles cannot develop unless you go thru thing that are designed to build you up spiritually.\r\n~As in regular muscles work out, to then recuperate, and are then build back stronger than ever.\r\n~The enemy wants to knock you down, but YOU must come back STRONGER.\r\n~The trying of your faith worketh patience, but let patience have its purpose worked.\r\n~You got to go thru some stuff to get some spiritual muscle, and all you can say God will PROVIDE.\r\n~It is HE that has made us and not we Ourselves.\r\n~When you are focused on what God has called you to do, you don\'t have time for the peanut gallery.\r\n~One of the reasons a whole lot of ppl get distracted is b/c you are so busy watching what others are doing, you lost focus on what God has called you to do. \r\n~No man can receive ANYTHING, except those thing that GOD has designated that you ought to have.\r\n2 Cor 4;18\r\n~Ever pray for someone and they start acting crazy (deploy of the enemy), its designed to distract you.\r\n~Walk by FAITH and not by SIGHT; HOLD ON AND KEEP BELIEVING GOD; You cant look at what you see; \"Fixed Focus of Faith\", you have to believe god is doing it even when it doesn\'t look like he is doing it.\r\n~When God is doing something in your life you cannot be distracted by what you see happening around you b/c many times what you see happening around you is nothing more than a distraction to move you away from the PROMISED.\r\n~Stop retaliating, stop fighting, the reason why you are so tired and spiritually exhausted is b/c you are trying to fight a fight in the flesh that can only be won in the spirit. TRUST GOD IS WORKING OUT THE SITUATION!!!!\r\n\r\nReasons Why YOU Can Not Quit:\r\n1. Whenever God creates something, he puts something that is innately characteristic to that thing on the inside of it, & b/c it\'s designed a particular way, it functions even though it shouldn\'t have functioned.\r\n2. When the spirit of God is on the inside of you, & you have been born again of the spirit of God, & adversity comes in of your life, there is something on the inside of you that will not let you ROLL OVER and DIE & GIVE UP b/c GOD has put the spirit of a VICTORIOUS PERSON on the inside of you.\r\n\r\nRomans 8:35-39\r\n\r\n~God NEVER promised Christians that we will be immune from the vicissitudes of life.\r\n~Life happens!!!\r\n~Not everybody that smiles is happy, sometimes ppl smile simply b/c they are strong. You\'ll be surprised what is behind their smile. They smile b/c they are conquering.\r\n~RESTORATION!!!!!!\r\n~DAVID said : Wait, wait on the lord, and while you wait watch your attitude; while you wait be of good courage.\r\n~God\'s Got This!!!\r\n\r\n2 Cor 4:7\r\n~You didn\'t make it thru, HE brought you thru. \r\n~If only you knew what God has placed inside of you. He has placed a treasure inside a fragile container.\r\n~People misjudge you b/c they look at your exterior but they don\'t know about the power of your God that is living on the inside of you & when they jumped on you, they should have left you alone.\r\n~There are some great things that God is ONLY going to do in your life after you \"DIE\".\r\n~There are some things that God is not going to do in your life, there is a power of God that isn\'t going to be displayed in your life until you \"DIE\"\r\n   Ex: Pride, Selfishness, Unforgiving, Always wants Remote themselves\r\nAnd when God kills all of that, that is when the real you comes out \"The Hidden Man\" he is something to be reckoned with.\r\n~But some of the battles that you continue to lose is b/c there are things in you about your character, attitude, personality, their are somethings that God is trying to KILL but YOU won\'t let it DIE.\r\n~Certain storms are designed to crush YOU.\r\n~Too much of YOU; You have to decrease so GOD can INCREASE.\r\nGarden of Gascinomy- olive garden; crushing, pressing\r\n~The anointing that is in you is not going to come forward until you go thru a crushing experience, & it is that crushing experience that will change how you pray.\r\n~ God had allowed you to be in a situation that was designed to crush you, so that a new YOU can be resurrected. Personal Crucifixion. \r\n~You are not going Under, You are Going Over; training for reigning.\r\n~Whatever you are going thru has a \"start date\" & a \"stop date\", which has already been determined by God.\r\n\r\nJob 14:14\r\n- Job was the greatest man of the East but God allowed the enemy to test him; but he kept on praising God \"appointed time\"'),
('7922', 'Could you post Dr. J\'s message 14-42-01 series online? I overslept this morning & only caught the last part of it. I do not miss his messages on GoodLife TV every morning. \r\n\r\nWhere the heck did this guy come from? I stopped going to churches because they did not preach this way ... like it or not ... I live too far away to visit but his messages have set me free in many areas & he is a confirmation to me in those areas. God Bless Dr. J!');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('7984', 'I wanted to know if your ministry has any further teaching or resources available about marraige.  I enjoyed Sunday\'s teaching very much and would like to learn more. I am single, but in talks of marraige. I would like to possibly learn more about conflict resolution, dealing with in-laws who overstep boundaries, communication, and/or finance. Ultimately, I\'d appreciate any material/resources your ministry may have geared toward marraige and having the right perspective in a biblical sense. '),
('7996', 'Hello,\r\n\r\nI am an in-home caregiver.  My preference is to volunteer for the 9 am service.  However, I will make every effort to serve when I am most needed.  Looking forward to it!  Thank you.  Geri\r\n\r\n'),
('8018', 'When God Judge A Nation\r\nPsalms 89:14\r\nHosea 4:6\r\n2 Peter 1:3\r\nJonah 3: 1-2\r\nGod is a God that Judges sin......\r\nLam 2:22\r\nMust have a reverence for God!!!!!!!\r\nYou better get your own oil.......(bridesmaid @ wedding)\r\nLam: 5: 1- 5 meaning of word )what has happen to us, 2 a lot of things not own b Americans, selling ourselves out 3 fatherless, provides and protects, Godly man is needed, do what you see kids, 4 we have to buy our water and things that use to be free, 5 instead of 1 have to work 2-3 jobs to make ends meet, no rest.....Could God be judging a Nation/ America \r\nRomans 1: 18-28  19 when you look at yourself you gotta know its a God, 20 clearly seen: ex sunset, the things God has made (nature),\r\nWhen you don\'t provide for your own your are a \r\nLove the person but not love the sin!!!!!!!!!\r\nSometimes you need to praise God for what he did not allow to happen.......\r\n2 Chronicals 7:14 Pray will change things, seek his face; fasting... \r\n\r\n'),
('8107', 'The last three Sundays it\'s been so cold I\'ve really been miserable.  I have a condition called raynauds and  I wear gloves for my hands.  Everything has been great all year, so it\'s only been the last 3 Sundays.  I\'d love to be comfortable at my church.  I really don\'t like complaining  and I hope all will be alright.       Thank you!'),
('8205', 'To whom it may concern:\r\nI have been a member of the church since 2009 I believe and currently serve on the ushers and greeters ministry.  I am not sure if pastor still meets with church members, but I am struggling with an issue and am trying to overcome it.  It is dealing with forgiveness, and I feel like I am hindering myself until I am able to overcome this.  I am desperately trying not to turn to bitterness (it has been over a year).  I do study the word, but am failing to put it to use.  Is there anyway possible that I would be able to meet with Pastor Jackson or maybe even Pastor Deborah for some council/advice?\r\nThank you!\r\nJoelle Kozik'),
('8211', 'I really would like to pray.. i feel berry discourage... its going to be almost a year of my divorce... and he had keept everything... my financial are dificult... and the pain don\'t seem to go away... \r\nThanks '),
('8234', 'Subject: \r\nFormation of a Life-Group at ROLCC for Families that have Children with Special Needs\r\n\r\nProposal B1DSP: Offer to Render Services to assist in helping ROLCC select Sensory and \r\n                          Occupational Therapeutic Future-proofed Technology, Resources and Design  \r\n                          Elements and Ergonomics during their Building Expansion Project and to    \r\n                          include Resources and Technology aimed at Accommodating Families that have \r\n                          Children with Special Needs. \r\n\r\n\r\nTo: Pastors Marvin Jackson & Deborah Jackson\r\n       Lead Pastors at The River of Life Christian Center in Orlando, FL\r\n\r\nFrom: Ryan Council, President & Founder of Breathe 150 Entertainment\r\n\r\n\r\n\r\nForming a Life Group for Families that have Children with Special Needs\r\n\r\nTracey and I appreciated the opportunity to meet with you both the other day and are thrilled with the idea of a life-group being developed at ROLCC for families that have children with special needs. We think that it will be a wonderful way for families like ours to connect and to build relationships with other families in the Central Florida area. Its not easy trying to raise children that have development delays or severe autistic malformations. Though it takes its toll on parents, the children are the ones that suffer the most because it is assumed that they cannot interact with others or enjoy the things that most of us doand those things that we take for granted. We commend you both on your wisdom and direction on being willing to initiate this life-changing community resource for the members of ROLCC and for those also in the Central Florida area.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nProposal B1DSP: (UNOFFICIAL PROPOSAL) \r\n\r\nPlease understand that this section of the document below is NOT an official contract or agreement to offer services to the River of Life Christian Center in Orlando, Florida. This section under the heading titled Proposal B1DSP- (Breathe, 1st Draft, Special Needs, Proposal) is simply a written offer to be submitted to Pastors Marvin Jackson and Deborah Jackson. This letter in its entirety with specifics to this section titled Proposal B1SP does not hold Ryan Council, Tracey Council, Ph.D., or Pastors Marvin Jackson and Deborah Jackson under any legal obligations to accept or to follow through with the offer written therein. It was drafted ONLY to submit an offer to Pastors Marvin Jackson and Deborah Jackson.\r\n\r\nTaking your advice from out of our meeting the other day concerning our business                  (Breathe 150 Entertainment) and our upcoming conference, Tracey and I have discussed some varying opportunities, that we believe could be mutually beneficial to both Breathe 150 Entertainment and to The River of Life Christian Center. I am currently in process of putting together an OFFICIAL PROPOSAL that will be titled Proposal B1SP and it will be very specific in outlining all of the details of all of the events and opportunities that I am proposing. \r\n\r\nUnofficially, I would like to offer my services to ROLCC that will be detailed in an official document titled: Proposal B1SP. I understand that ROLCC is in the process of a building expansion with a focus point on designing a room(s) that can accommodate sections for the growing needs of children during worship services. As per our discussion, you both understand those needs within the Central Florida community and particularly within the ROLCC family for churches to begin to provide resources for families that bring their children to worship services and especially for those that have children with special needs. The services that I would like to offer you should help as you make preparations within the scope of the building expansion.\r\n\r\nSince I am a father of a child that has special needs, I understand what parents are looking for when it comes to accommodations, resources, and technology that children need, especially when they have development delays. Ive made connections within the medical and educational community that most parents dont get a chance to make because their children have not been repeatedly in the hospital; their children have not had to have surgery; their children do not have to be in a special education program. Unlike most, I am comfortable with saying that I have an advantage that could be beneficial to the ROLCC community. Besides that, I spent a great portion of my career networking with and working alongside of CTS-certified audiovisual design technicians; and I spent 5 years leading an AV redesign for a Fortune 500 marketing advertising company that was completed upon me relocating to Georgia. I played the central part in negotiating and re-designing training and conference rooms for the corporate headquarters of an international company and I was the lead technician for all of their broadcasts and recordings. My recent Entertainment Business degree helped me to better understand how to function in a business world and to understand that money is not limitless. It has reshaped my thinking and I believe has prepared me to function practically when needing to make conscious decisions.\r\n\r\nSo again, I would like to offer my services. Those services would include handling the details of acting as a co-project manager for the section of the expansion project for a special needs family area/room pertaining to: \r\n1. Creating a timeline,\r\n2. Gantt Charts, \r\n3. Creating presentations for ROLCC administration, \r\n4. Working with AV designers (contracted and sub-contracted personnel) as the project moves along for the section(s) pertaining to a special needs family area/room\r\n5. Working with educators, occupational and physical therapists in the design/bid process on what materials, resources, and technology we should integrate into the ergonomics of the design, 6. Reemphasizing and assisting with mentoring the staff and the ROLCC community on creating an inviting atmosphere for families that have children with special needs,  \r\n7. Submitting budget requests,\r\n8. Keeping the project on budget,\r\n9. Keeping the project on time\r\n\r\nPlease understand that I am not in support of or an advocate for simply designing a room to sequester families away that have children with special needs. Though I understand the demand and importance of maintaining an atmosphere where quality broadcasts and recordings can take place within the sanctuary, the idea of corralling families into a room because of the dynamics of their family falls under profiling and stifles the worship experience and spiritual growth for those families (please see the linked article:\r\nhttp://www.lifenews.com/2014/08/25/the-hardest-place-for-us-to-take-our-special-needs-child-our-church/). \r\n\r\nOur goal within the aspects of our business and our personal mission is to re-shape the ideas, attitudes, and worldview of the Christian church community when it comes to individuals that have special needs. We hope that you will support us in this mission.  \r\n\r\nFor your consideration, Ive attached my LinkedIn Profile for your review of my skill set:\r\nhttps://www.linkedin.com/pub/ryan-council/2a/a87/9b5\r\n\r\nI hope that you will find me to be a resource that you can utilize for the growing needs of the ROLCC family. My offer is NOT a request to take over someone elses current role in the church. It is an offer that I plan to attach with favorable conditions (for both my company and for ROLCC in pertaining to our inaugural conference in 2015) moving forward as I outline the details within the official proposal to be submitted to you by next week (based upon your response to this unofficial proposal). Please feel free to get in contact with me if this unofficial submission deems to be favorable to you both. *As I am sure you do as well, I always sit down with my legal aid when drafting up official contracts and documents, and I hope that we will be able to do so as we move forward from here. Thank you and God bless.\r\n\r\n* Legal aid reference and the suggestion of utilizing them helps to keep me on task and not to violate the business relationships that I come into contract with. It is my hope to utilize them (if we are somehow able to do business with each other) so that you can continue to lead me as my pastoral covering and that no dissention arises to break up the church community in which we are enjoying. Every effort (both in business and in private in regards to me and my family) will be to preserve the church fellowship that we have.   \r\n        \r\n\r\n     \r\n\r\n'),
('8263', 'I am the new manager of your locally owned and operated Domino\'s Pizza...I would like to become more involved in our local community and one way is through connecting with local churches.  I would love to meet or speak with someone regarding the specials we now have for churches and church groups.  Hope to hear from someone!'),
('8264', 'Take notes here, then email them to yourself by clicking below.\r\n10/5/14\r\nPursuing God\'s Best\r\n\r\nDeuteronomy Ch 28: 1-14\r\nJoshua Ch 24: 14-15\r\nMatthew Ch 7: 24-27 (House on Rock; House on Sand)\r\nActs Ch 10: \r\n\r\n'),
('8289', 'Please pray for Mickel Brown, at Halifax hospital in ICU intensive care unit on life support .\r\nPlease pray that Gods power show up and completely restoration him.  \r\nFor his son Mikel Jr. and Matthew \r\nhis  Mother Ms. Williams for Salvation wisdom strength and direction for the family\r\n\r\nThank you,');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('8301', 'Lee and I soliciting the sincere and fervent prayers of our church family for a complete revealing, exposing, removing of anything that\'s not of God and healing for Lee. We denounce any and all words or diagnosis of any type of frontal lobe (cognitive) dementia or any other brain issues. We do believe that the prayers of the righteous availeth much. In Jesus Name Amen.'),
('8328', 'Wait on the Lord. While you are waiting, do not wander. Wait and still praise Him. Wait and still go to church. Wait and still do good. Wait and still believe that God will see you through. Stay in the word because there is comfort in the word of God.\r\n\r\nWrite off the words that are not comforting, uplifting and encouraging. People will cause you to stress.\r\nDo not worry about your haters, while God is comforting you. Isaiah 51:12-13\r\n\r\nIsaiah 43:19 \r\n\r\nGod comforts us with His spirit. He brings you peace.\r\nGod comforts you through other people. God sends the right people to you.\r\nGod comforts you in His word. Read the bible. There are stories of people in the bible who went through rough times, God carried them through.\r\n\r\nGod already has a plan for you.\r\n'),
('8374', 'Good evening, Pastors Marvin and Dr. Debra Jackson:\r\n\r\nI\'ve missed the last two services because I got called into work, but I called in and left a message for you on the previous Sunday when you were scheduled to make an announcement about developing a life group for families with children that have special needs. I also submitted a draft proposal as you requested. I wanted to make sure that we had a chance to talk about it when you were ready. There\'s a lot of detail in that draft that I would like to simplify and I think that it would be best simplified in person. I promiseno power-point presentations this time :) \r\n\r\nPlease let us know when your schedule is open for another brief conversation if you would like. We took your feedback from our previous discussion and have really trimmed a lot of the fat out of the vision for our business. We look foreword to speaking with you soon. Thank you.\r\n\r\nSincerely\r\nRyan Council\r\n757-339-7965'),
('8380', 'I have supplied a brief testimonial in regards to my background and experiences. I truly believe with my wealth if experiences, background and education I can fulfill any position... I can provide references and any other related information.'),
('8394', 'Good morning,\r\n\r\nPastor Jackson indicated towards the end of service that we could ask him for his notes of yesterday\'s message (10/15/2014). I would like to know how would I go about requesting them?\r\n\r\nThank you,\r\nKia Anderson'),
('8412', 'I was recently diagnosed with colon cancer and on Wednesday, October 22, I am scheduled for surgery to have the cancer removed. The procedure is an resection of the intestine. I am requesting prayer for a successful surgery and to be totally cancer free once its removed with no need for chemo after. Thank you.'),
('8413', 'God expose, remove and reveal anyone that is not to be on my journey. God\'s purpose is not for everyone in your life.\r\nStop trying to fit in when God has called you out.\r\nWhen God speaks to you it is for you. Be caeful who you speak to about God\'s message for you because some people will try to mess you up on your journey.\r\nTime proves all things. Whoever is inyour life, time will reveal who they really are.\r\nWilderness is a humbling place. The wilderness is where you remember eating only rice and green peas puree, having no meat. Wilderness is being in a place that humbles you, where you did not have much but you made it through as part of your journey.\r\nMost people will hate on your glory when they did not your story\r\nDeuteronomy 8:2\r\nAppreciate your journey because God is trying to take you somewher new and is getting you ready for it now\r\n'),
('8417', '11am service Oct.19, 2014 Notes\r\n\r\nExodus 13:17-18\r\n\r\nIn order for God to increase, I have to decrease. God has to be magnified. I have to be stripped of what I am holding on to so I can go where God has already prepared for me to be.\r\nGod has to purge you from people because they are not meant to go on with you in your journey.\r\nLearn to walk by myself. There are some journeys you will have to walk through by yourself.\r\nTime proves all things. God is calling you out. The reason why you still on certain journeys is because God is purging out what I am still holding on to (people, thoughts, traditions, ways...)\r\nGod will take you throuh wilderness.\r\n You will never appreciate your destination unless you learn to appreciate your journey.\r\nPeople don\'t judge you on your journey (all that you went through to get to where you are), they judge you on your destination (where you are now).'),
('8431', 'Topic: Pursuing God\'s Best: Faith for Divine Health and Healing\r\nWed Night Bible Study\r\nRiver of Life Church\r\n\r\nHow can I pursue the best possible relationship with God??\r\n\r\nHebrews 10:35 (Read this scripture!)\r\n\r\n3 John 1:2\r\nJeremiah 30:17\r\n\r\nThings that Make up Soul of Man: 1. Your Will  2. My emotions  3. My Thoughts\r\n\r\nSpiritual death is when are disconnected to God. You have to renew your mind with the Word of God and get another understanding of the purpose of our bodies.\r\n\r\nWhen purpose is unknown, misuse is inevitable\r\n\r\nRomans 12-1-2; 1 Cor 6:12-13\r\n\r\nThe body is for the Lord\r\n\r\n1 Cor 11: 29-33; We have been purchased with a price. Our bodies belong to God. Leviticus 11:9\r\n\r\n\r\n\r\n\r\n'),
('8433', 'Jeremiah 30:17- noetic effects of sin; the need for a revelation regarding our bodies and their purpose.  Renew your mind and understand your purpose- whenever purpose is unknown misuse is inevitable.\r\nRoman 12:1-2- present your body as a living sacrifice\r\n1 Corin 6:13\r\n2 peter 2:19\r\n1 Corin 11:29-33- \r\nLeviticus 11:9\r\nShellfish highest cholesterol content\r\npork- contains a lot of poison- very harmful to your body\r\nGod gives us free will to choose- but whatever harm your bring to your body is on your \r\n.   ');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('8454', 'Good evening, Pastor and Dr. Deborah Jackson:\r\n\r\nTracey and I hope all is well. We had to make the decision to postpone or at least push off launching our event. We just weren\'t able to pull in the support in the time frame that we needed it to be in. We\'re trying to work some other angles but it\'s just not coming together the way we would like. \r\n\r\nAnyway, I wanted to simplify the proposal that I sent to you. It was a bit over-detailed, but I wanted to make sure that I was as thorough as possible. However...to keep it simple...I just would like to have the opportunity to help ROLCC out if and when we are in a serious position to make a move on developing your ideas for a family life center, interactive play rooms, and anything dealing with future proofing the facility to accommodate families with children and those that have children with special needs. The services that I listed in the draft proposal was for no charge. I was trying to volunteer my services to the ministry. I\'m not looking to replace anyone\'s role on staff, but if you were ready to move in that direction, I\'m at your disposal to help. Have a great week. '),
('8455', 'Fix for faltering faith teaching. Oct 26, 2014 11am Service\r\nMark 9:14-30\r\nGod has allowed certain things in your life, to test you\r\nDon\'t stop waiting, don\'t stop believing.\r\nFaith involves sacrifice.\r\nCauses that falters faith: disappointment, time, sight\r\nDon\'t allow disappointment to cause your faith to falter Romans 8:28\r\nproblem is we are too fast, want a microwave blessing.God does not want you to get there too soon when it is not ready yet.\r\nLife is filled with disappointment.\r\nDon\'t allow your current situation to be your permanent situation. Devil will have you settle. devil is a lie!\r\nGod has a time to bless you.\r\n Genesis 17:21 Abraham and Sarah\r\nGod will teach you how to wait; anythin that is premautre is defective\r\nStory of Balaam and the donkey\r\nSight will mess you up. Your faith will alter with what you see sometimes\r\nYour breakthrough is just around the corner. Don\'t stop!\r\nGod will bring you into it little by little until you cn possess it, own it.\r\nHow are you handling your blessings right now?\r\n\r\nDon\'t worry about time. Every delay is working for you in favor. \r\nWalk by faith and not by sight.\r\n\r\n\r\n');
